// components/MyLayout.js

import Header from './Header';
import Link from 'next/link';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Link style = {layoutStyle} href = '/'>
        Home
    </Link>
    <Link style = {layoutStyle} href = '/about'>
        About
    </Link>
    <Header />
    {props.children}
  </div>
);

export default Layout;
